let user = require("../../../registration/registration.json");

const RegistrationWithCheckBox = () => {
  debugger;
  return (
    <div>
      <div>
        {Object.keys(user?.inputWithRadioButton).map((value, index) => {
          return (
            <div>
              <label>{value}</label>
              {user?.inputWithRadioButton.gender.map(value => {
                return (
                  <div>
                    <lable>{value}</lable>
                    <input type="radio" />
                  </div>
                );
              })}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default RegistrationWithCheckBox;
